import './App.css';
import NavBar from './components/navbar/Navbar';
import {Route,Routes} from "react-router-dom"
import { Home } from "./pages/Home"
import { About } from "./pages/About"




function App() {
  return (

    <Routes>
      <Route path="/" element ={< Home/>}/>
      <Route path="./About" element ={<About/>}/>


    </Routes>

  );
}

export default App;
